import React, { useState } from "react";

import Filter_TabBar_Closed_progresser from "./Filter_TabBar_Closed/Filter_TabBar_Closed_progresser";

export const Filter_TabBar_Part = () => {

    const [ FilterTabBar, updateStatus ] = useState('opened')
    const Url = new URLSearchParams(document.location.search)
    const Status = Url.get('FilterTabBar')


    switch(Status){

    case('undefined'): return <React.Fragment>

        <Filter_TabBar_Closed_progresser status={FilterTabBar}/>

    </React.Fragment>

    case('opened'): return <React.Fragment>

    <Filter_TabBar_Closed_progresser status={FilterTabBar}/>

    </React.Fragment>

    case('closed'): return <React.Fragment>

    <Filter_TabBar_Closed_progresser status={FilterTabBar}/>

    </React.Fragment>

    }
}

export default Filter_TabBar_Closed_progresser
